// src/components/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
    return (
        <div style={{ padding: '20px' }}>
            <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <h2>Dashboard</h2>
                <nav>
                    <Link to="/product-management" style={{ marginRight: '15px' }}>Product Management</Link>
                    <Link to="/user-management" style={{ marginRight: '15px' }}>User Management</Link>
                    <button onClick={() => console.log("Logout clicked")} style={{ padding: '5px 10px' }}>Logout</button>
                </nav>
            </header>
        </div>
    );
};

export default Dashboard;
